const e=JSON.parse('{"key":"v-6b6fc83b","path":"/zh/guide/model-form-trans.html","title":"表单字段翻译","lang":"zh-CN","frontmatter":{},"headers":[{"level":3,"title":"语言包名称","slug":"语言包名称","link":"#语言包名称","children":[]},{"level":3,"title":"示例","slug":"示例","link":"#示例","children":[]},{"level":3,"title":"公共翻译","slug":"公共翻译","link":"#公共翻译","children":[]}],"git":{"createdTime":1701780913000,"updatedTime":1701780913000,"contributors":[{"name":"Moments","email":"554676262@qq.com","commits":1}]},"readingTime":{"minutes":1.17,"words":352},"filePathRelative":"zh/guide/model-form-trans.md","localizedDate":"2023年12月5日","excerpt":"<h1> 表单字段翻译</h1>\\n<p>数据表单表单中所有使用到字段的地方都会自动读取语言包中的翻译。</p>\\n<blockquote>\\n<p>{tip} 语言包的详细使用方法请参考<a><a href=\\"/dcat/zh/guide/trans.html\\" target=\\"blank\\">多语言</a></a>。</p>\\n</blockquote>\\n<h3> 语言包名称</h3>\\n<p>语言包名称需要与控制器名相对应，假如控制器名<code>UserProfileController</code>，则对应的语言包为<code>resources/lang/{当前语言}/user-profile.php</code>（需要转化为小写中划线风格）。</p>"}');export{e as data};
